import Header from "./topnavbar";
import styled from "styled-components";
const ContentsBody = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
`;
const Layout = ({ children }) => (
  <div>
    <Header />
    <ContentsBody>
      <Container>
        <Row>{children}</Row>
      </Container>
    </ContentsBody>
  </div>
);

export default Layout;
